        <button class="button" onclick="DownloadAsImage()">Download</button>

<script>

function loadValue() {
    var x = document.getElementById("bet1text").value;
    document.getElementById("bet1").textContent = x;

    var xa = document.getElementById("result1text").value;
    document.getElementById("result1").textContent = xa;

    var y = document.getElementById("bet2text").value;
    document.getElementById("bet2").textContent = y;

    var ya = document.getElementById("result2text").value;
    document.getElementById("result2").textContent = ya;
}

function DownloadAsImage() {
  domtoimage.toBlob(document.getElementById('svg_element'))
    .then(function(blob) {
      window.saveAs(blob, 'BlueBet.png');
    });
}

function HideBet2() {
  document.getElementById("bet2").style.display = "none";
  document.getElementById("result2").style.display = "none";
  document.getElementById("hide").style.display = "none";
  document.getElementById("show").style.display = "block";
}

function ShowBet2() {
  document.getElementById("bet2").style.display = "block";
  document.getElementById("result2").style.display = "block";
  document.getElementById("hide").style.display = "block";
  document.getElementById("show").style.display = "none";
}

</script>
